import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="header-container flex">
          <div className="logo font-white">Borgaon</div>
          <div className="search-bar">
            <form>
              <input type="text" class="searchbar" />
              <button type="submit">Submit</button>
            </form>
          </div>
          <div className="login-greet font-white">Hello, Sign In</div>
          <div className="shopping-cart font-white">
            <ShoppingCartIcon />
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
